import React from "react";
import Separator from "../../separator/separator";
import "./skills.css";
function Skills() {
  return (
    <div>
      <Separator />
      <label className="section-title">Skills</label>
      <div>
        <i class="devicon-cplusplus-plain"></i>
      </div>
    </div>
  );
}

export default Skills;
